import React, { Component } from 'react';
import { Col, Row } from 'react-bootstrap';
import LoadingSpinner from '../../shared/loading_spinner';

export default class TopInfo extends Component {
  isEmpty(obj) {
    return Object.keys(obj).length === 0;
  }

  render() {
    const {
      id,
      name
    } = this.props.game;
    console.log(this.isEmpty(this.props.game));

    if(this.isEmpty(this.props.game)) {
      return <LoadingSpinner />
    } else {
      return (
        <Col lg={{ span: 9, offset: 1 }}>
          <Row className="pb-3">
            <Col>
              <h5>Developer</h5>
              {/* <p>{props.game.developers[0].name}</p> */}
            </Col>
            <Col>
              <h5>Publisher</h5>
              {/* <p>
                      {props.game !== undefined
                        ? props.game.publishers[0].name
                        : ''}
                    </p> */}
            </Col>
            <Col>
              <h5>Available</h5>
              {/* <p>
                      {props.game !== undefined
                        ? props.game.released
                        : ''}
                    </p> */}
            </Col>
          </Row>
          <Row>
            <Col>
              <h5>Metacritic</h5>
              {/* <p>
                      {props.game !== undefined
                        ? props.game.metacritic
                        : ''}
                    </p> */}
            </Col>
            <Col>
              <h5>Rating</h5>
              {/* <p>
                      {props.game !== undefined
                        ? props.game.rating
                        : ''}
                    </p> */}
            </Col>
            <Col>
              <h5>Platform</h5>
            </Col>
          </Row>
        </Col>
      );
    }


  }
}
